import {useState, useEffect} from "react";


const Form = () => {
    const [kiosks, setKiosks] = useState(null)

  var headers = {}
  useEffect(() => {
    fetch('https://asia-southeast1-total-dreamer-297509.cloudfunctions.net/generate-latlong/coordinates', {method : "GET", mode: 'no-cors', headers: headers})
      .then(res => {
        return res.json();
      })
      .then(data => {
        setKiosks(data);
        console.log(data);
      })
  }, [])

    return ( 
        <div>
            {kiosks.map(kiosk => (
                <div>
                <h2>{kiosk.name}</h2>
                <h2>{kiosk.latitude}</h2>
                <h2>{kiosk.longitude}</h2>
                </div>
            ))}
        </div>
     );
}
 
export default Form;
